import React, { useState } from 'react';
import { saveFormData } from '../services/api';


const CategorizedForm = ({ addQuestion }) => {
  const [categories, setCategories] = useState([
    { name: '', items: [] },
  ]);
  const [options, setOptions] = useState(['']); // Options that can be categorized
  const [categoryName, setCategoryName] = useState('');
  const [optionName, setOptionName] = useState('');

  // Add a new category
  const handleAddCategory = () => {
    if (categoryName.trim()) {
      setCategories([...categories, { name: categoryName, items: [] }]);
      setCategoryName('');
    }
  };

  // Delete a category
  const handleDeleteCategory = (index) => {
    const updatedCategories = [...categories];
    updatedCategories.splice(index, 1);
    setCategories(updatedCategories);
  };

  // Add a new option
  const handleAddOption = () => {
    if (optionName.trim()) {
      setOptions([...options, optionName]);
      setOptionName('');
    }
  };

  // Delete an option
  const handleDeleteOption = (index) => {
    const updatedOptions = [...options];
    updatedOptions.splice(index, 1);
    setOptions(updatedOptions);
  };

  // Save the categorized question
  const handleSave = async () => {
  const question = {
    type: 'categorized',
    data: {
      questionText: 'Categorize these items',
      categories,
      options,
    },
  };

  try {
    // Save question to the database via saveFormData
    const response = await saveFormData('/questions', question);
    console.log('Question saved:', response.data);

    // Add question to the form
    addQuestion(question);
  } catch (error) {
    console.error('Error saving question:', error);
  }
};


  return (
    <div className="p-4 border rounded shadow-sm mb-6">
      <h2 className="text-xl font-semibold mb-4">Categorized Question</h2>

      {/* Category Management */}
      <div className="mb-4">
        <label className="block text-sm font-medium mb-2">Add Category</label>
        <div className="flex items-center gap-2">
          <input
            type="text"
            className="border rounded p-2 flex-grow"
            placeholder="Category Name"
            value={categoryName}
            onChange={(e) => setCategoryName(e.target.value)}
          />
          <button
            className="bg-blue-500 text-white px-4 py-2 rounded"
            onClick={handleAddCategory}
          >
            Add
          </button>
        </div>
        <ul className="mt-3">
          {categories.map((category, index) => (
            <li key={index} className="flex justify-between items-center p-2 bg-gray-100 mb-2 rounded">
              <span>{category.name}</span>
              <button
                className="text-red-500"
                onClick={() => handleDeleteCategory(index)}
              >
                Delete
              </button>
            </li>
          ))}
        </ul>
      </div>

      {/* Options Management */}
      <div className="mb-4">
        <label className="block text-sm font-medium mb-2">Add Options</label>
        <div className="flex items-center gap-2">
          <input
            type="text"
            className="border rounded p-2 flex-grow"
            placeholder="Option Name"
            value={optionName}
            onChange={(e) => setOptionName(e.target.value)}
          />
          <button
            className="bg-blue-500 text-white px-4 py-2 rounded"
            onClick={handleAddOption}
          >
            Add
          </button>
        </div>
        <ul className="mt-3">
          {options.map((option, index) => (
            <li key={index} className="flex justify-between items-center p-2 bg-gray-100 mb-2 rounded">
              <span>{option}</span>
              <button
                className="text-red-500"
                onClick={() => handleDeleteOption(index)}
              >
                Delete
              </button>
            </li>
          ))}
        </ul>
      </div>

      {/* Save Question */}
      <button
        className="bg-green-500 text-white px-6 py-2 rounded"
        onClick={handleSave}
      >
        Save Question
      </button>
    </div>
  );
};

export default CategorizedForm;
